import React from "react";
// import { Link } from "react-router-dom";
import { Card, Col, Container, Image, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";

import "./UserItem.css";

const UserItem = props => {
  const Message = () => {
    if (props.type === "Like")
    {
      return <h3>Like your profile</h3>
    }
    if (props.type === "Visit")
    {
      return <h3>Visit your profile</h3>
    } 
    if (props.type === "Chat")
    {
      return <h3>Send you a Message</h3>
    }
  }
  console.log(props.image);
  return (
    <Card className="bg-dark text-white card__container">
      <Row>
        <Col>1 of 3</Col>
        <Col>
          <Image src={props.image} roundedCircle className="image__profile" />
          <h1 className="title__card">{props.name}</h1>
          <Container className="card_center">
            <Row>
              <Col xs={6}>
                <Card.Link href="#" className="like_dislike">
                  <Image
                    src={require("../../img/iconProfile/heart.png")}
                    width="50px"
                    height="50px"
                  />
                </Card.Link>
              </Col>
              <Col xs={6}>
                <Card.Link href="#" className="like_dislike">
                  <Image
                    src={require("../../img/iconProfile/remove.png")}
                    width="50px"
                    height="50px"
                  />
                </Card.Link>
              </Col>
            </Row>
          </Container>
        </Col>

        <Col>3 of 3</Col>
      </Row>
    </Card>
  );
};

export default UserItem;
